import React from "react";

const Services = () => {
  return (
    <div>
      <style>{`
        .services-banner {
          height: 400px;
          background-image: url('https://images.unsplash.com/photo-1581091226825-a6a2a5aee158?ixlib=rb-4.0.3&auto=format&fit=crop&w=1470&q=80');
          background-size: cover;
          background-position: center;
          background-repeat: no-repeat;
          display: flex;
          align-items: center;
          justify-content: center;
          position: relative;
          color: white;
        }

        .services-banner::before {
          content: "";
          position: absolute;
          inset: 0;
          background-color: rgba(0, 0, 0, 0.6);
        }

        .services-heading {
          position: relative;
          z-index: 1;
          font-size: 3rem;
          font-weight: bold;
        }

        .services-content {
          padding: 40px;
          text-align: center;
        }

        .services-content h2 {
          font-size: 24px;
          margin-bottom: 10px;
        }

        .services-content p {
          font-size: 16px;
          color: #333;
        }
      `}</style>

      {/* Banner Section */}
      <section className="services-banner">
        <h1 className="services-heading">Our Services</h1>
      </section>

      {/* Page Content */}
      <div className="services-content">
        <h2>Services Page</h2>
        <p>This section can include descriptions or service offerings.</p>
      </div>
    </div>
  );
};

export default Services;
